import React from "react";
import { Container, Button, Row, Col } from "react-bootstrap";

const Resume = () => (
  <Container>
    <Row>
      <Col>
        <h2>Education</h2>
      </Col>
      <Col>
      <h2>Hello</h2>
      </Col>
    </Row>
  </Container>
);

export default Resume;
